import React from "react";

function Nav() {
    return (
        <div className="navbar">
            <div className="navbar-title">
            <h1>Company Name/Logo</h1>
            </div>

            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Recipes</li>
                <li>Random</li>
            </ul>
        </div>
    );
}

export default Nav;
